INSERT INTO `lime_old_survey_62863_20130823104952` VALUES (14, '2013-08-20 14:07:01', 10, 'en', '2013-08-20 14:07:01', '2013-08-20 13:56:18', 'http://survey.ntads.co.uk/index.php?sid=62863&lang=en', 'A4', '', '', '', '', 'Y', '', '', '', '', '', '', '', 'A3', '', NULL, '', '', NULL, 'A3', 'A4', '', '9', '2', 'Edinburgh', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Map', NULL, NULL, NULL, NULL, '15', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', 'Y', '', '', 'Y', '', '', '', 'Y', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', 'Cragside, Beadnell, Lindisfarne, Berwick', 'Y', '', '', '', '', 'Y', '', '', '', '', 'Y', 'The Times', 'A2', 'N', 'The scenery', 'Going to Berwick on Tweed on the way to Edinburgh - stopped off hoping to find a pub for lunch.  Couldn\\''t find any that were open or decent in town but used one \\"last pub in England\\" which was very disappointing. Signposts to visitor attractions limited. Couldn\\''t find any car parks. Visited other pubs - some extremely poor and disappointing.', 'A3', 'A4', 'A4', 'A7', 'A7', 'A7', 'A7', 'A5', 'A7', 'A7', 'A3', 'A3', 'A5', 'A3', 'A3', 'A1', 'A3', 'A3', 'A8', NULL, 'A4', 'A5', 'A2', 'A2', 'A4', 'A6', 'A6', 'A2', 'A2', 'A1', 'N', 'A2', 'A4', 'Y', 'Y', 'I would recommend parts of Northumberland but not Berwick. That place was so disappointing, given how much history is linked to it. It needs to develop into a more tourism-centred place, like for example Canterbury, York, Exeter etc', 'Scotland, Wales, England, Northern Ireland', 'A1', '', 2, 'A4', 54, '180', '180', '0', '40', '20', '0', 2, 'N', 'A6');
