INSERT INTO `lime_old_survey_89634_20130619112603` VALUES (278, '2013-05-10 21:31:35', 3, 'en', 'A8', '', 'A6', 'A1', 'A3', 'Y', 'Y', '', 'Y', 'Y', '', 'Y', '', '', 'Y', '', 'Y', '', '', 'I am always looking at the Nprthunbrian area as it is oneof  the lost beautiful parts of this country. I have travelled around it many times in the past. The name Alnwick evokes many nostalgic memories, it has a magic all its own. I do not suppose it is as serene and peaceful as it was when I was a lad, but it will still hold all its charm for me. My father nearly took a job up there but did not drive so lost the opportunity, much to my disappointment. There are many other past of Northumbria that I know from my visits too.', '', 'Y', '', '', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', '', 'Y', 'Y', 'Y', 'I am an artist who paints in oils and I cannot think of a lovelier place to live and see out my days painting the stunning countryside and coastal areas.', '001', '006', '003', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '002', NULL, NULL, '001', '003', '003', 'Because it is  now 2013.', 'Y', 'eric glendenning', '01527-591935', 'eglendenning@aol.com');
