INSERT INTO `lime_survey_18322` VALUES (260, '2012-05-02 12:20:55', 4, 'en', NULL, 'A2', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'Y', 'Claire Judd', 'claire@judd62.freeserve.co.uk', '01638 742060');
INSERT INTO `lime_survey_18322` VALUES (261, '2012-05-02 12:29:10', 4, 'en', NULL, 'A3', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Love England . Been thyere over 5 times and am eager to go again and again. Keep looking for places to visit and things to do. Will be visiting England next year for the Ashes and cant wait to tour around between tests. Northumberland sounds and looks fantastic. Am very interested in old historic buildings, rivers which meander through the pretty countryside, anything old and Roman,anything artistic, anything picturesque that I can paint, in fact I am entranced with its history , its military and its ancient ruins, castles and buildings. I cant wait to breathe the air of England again. Northumberland appears to satisfy nearly all of our wants for everythuing. I only hope the weather is fine and not too cold.', 'Y', 'John Leofric Barns', 'barnsie@iinet.net.au', '+61297928425');
INSERT INTO `lime_survey_18322` VALUES (262, '2012-05-02 12:22:57', 4, 'en', NULL, 'A1', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'very good website easy to follow', 'Y', 'Phyllis Jamieson', 'sweetviolet1948@yahoo.co.uk', '01524771346');
