INSERT INTO `lime_survey_18322` VALUES (578, '2012-05-02 15:28:48', 4, 'en', NULL, 'A1', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'This is a user friendly website with a massive amount of useful information. Difficult really to suggest any improvements, however, how about some \\"money off\\" vouchers to some of the attractions listed. In these difficult financial times, money saving discounts would attract people to the attractions, especially given the prices of some which are a tad expensive should a family be touring and visiting several attractions. ', 'Y', 'peter lynch', 'peter.lynch7@ntlworld.com', '01642491604');
