INSERT INTO `lime_survey_18322` VALUES (659, '2012-05-02 17:05:37', 4, 'en', NULL, 'A1', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'What about occasional articles about places in Northumberland written by people actually living in these locations giving inside information on highlights, new shops/restaurants and why they think a tourist should visit their town/village. You could invite submissions from local individuals and possibly offer a prize.  Alternatively, the articles could be condensed down to a simple set of ten or so questions that a local to the area could be put on the spot to answer, ie: best tourist attraction, most famous person to live there, local food speciality etc.', 'Y', 'ALAN LITTLE', 'edetman@hotmail.com', '07903550512');
