INSERT INTO `lime_survey_18322` VALUES (752, '2012-05-02 18:58:43', 4, 'en', NULL, 'A1', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'It seems fine to me.', 'Y', 'Michael Iversen', 'michaeliversen@hotmail.co.uk', '07904004639');
INSERT INTO `lime_survey_18322` VALUES (753, '2012-05-02 19:19:11', 4, 'en', NULL, 'A1', '', 'Y', 'A1', 'A1', 7, NULL, '', '', '', '', '', 'Y', 'Y', '', '', '', '', '', 'A4', '', 'A2', 2, 850, 200, 250, 600, 'You have a very informative website.We have visited Northumberland four times now in the last four years.Your website we have found on all these occassions so very good especially as we bring our dog on holiday with us.We have fallen in love with your county not only for it\\''s beauty but the peace & quiet, the excellent food especially the local cheese and beer.For the first time we have seen red squirrels & a lot of different plants & birds.We are already planning our next visit.As we live in Kent,it is rather a long journey for us and your website keeps us very much up to date with what is going on.Well done.long may you continue.', 'Y', 'Mrs Priscilla Baker', 'bakerirpd@aol.com', '01634 402106');
INSERT INTO `lime_survey_18322` VALUES (755, '2012-05-02 19:03:37', 4, 'en', NULL, 'A1', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'I have always enjoyed reading the content, especially information about events when I will be visiting.', 'Y', 'Mrs Anne Skillings', 'anneskillings@hotmail.com', '01952460095');
