INSERT INTO `lime_survey_18322` VALUES (759, '2012-05-02 19:11:53', 4, 'en', NULL, 'A2', '', 'Y', 'A2', 'A2', 2, NULL, '', '', 'Y', '', '', '', '', '', '', '', '', '', '-oth-', 'Through family in Hexham', 'A2', 1, 200, 90, 80, 0, 'As a Northumbrian now living abroad (in Denmark), I would appreciate information about international travel connections into Newcastle airport - new flight routes starting up, old ones discontinued etc.\r\n\r\nIn connection with the previous question, I do not book accommodation as I stay with my family in Hexham.', 'Y', 'Graham Tully', 'gttranslation@mail.dk', '+45 43532628');
