INSERT INTO `lime_survey_18322` VALUES (1020, '2012-05-03 23:24:22', 4, 'en', NULL, '-oth-', 'have static caravan so committed to many visits', 'Y', 'A4', 'A3', 0, NULL, 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', '-oth-', 'have static caravan so own accommodation', 'A4', 2, NULL, NULL, NULL, NULL, 'The survey said it was about the website, but it wasn\\''t. I have many comments I could make, but no space to do so. When I completed the questions on whether the website had pursuaded me to come at all or to stay longer, my answers were \\''no\\'', but although I tried, the survey did not let me give this answer(!!) - it said a compulsory question had not been answered. When I ticked \\''possibly\\'' to both questions, it did allow me to proceed! Hence, this questionnaire will produce totally invalid answers - perhaps that\\''s what you want. Questions on how much I spent were then asked - this is nothing to do with the website quality and I don\\''t in any case tot up how much I spend each visit, so have not answered. If you really want peoples\\'' views on the site, you need to get a decent survey, where people are not forced into giving incorrect answers.', 'Y', 'Mrs Greenslade', 'eunice.greenslade@btinternet.com', '017488866u38');
