INSERT INTO `lime_survey_24995` VALUES (10, '2013-08-06 12:15:28', 2, 'en', NULL, 'Building Dreams: Walk of Wonder', 'Cragside', 'National Trust', 'Rothbury', 'NE65 7PX', 'Susie Kennedy', '01669 620333', 'susie.kennedy@nationaltrust.org.uk', 'http://www.nationaltrust.org.uk/cragside/things-to-see-and-do/events/', '@NTcragside', 'https://www.facebook.com/cragside', 'As part of 150th anniversary at Cragside, meet the artists behind the spectacular Building Dreams: Artworks installations.  Various events are taking place throughout the Summer, so make sure you don’t miss out.\r\n \r\nWalk of Wonder: Irene Brown\r\nThursday 15 August, 7pm\r\nShare an evening of intrigue as Cragside House is transformed into a gallery of wonder.  Special evening walk led by artist Irene Brown.\r\n£6 per person.\r\n', '2013-08-15', '2013-08-15', '19:00', '21:00', '[{ "title":"Artist Irene Brown with her work, Fulmination","comment":"","size":"245.183","name":"a-2a%20resized%20SM.jpg","filename":"fu_ztenjmk97ycs6vr","ext":"jpg" }]', 1, 'Y', '£6.00 per person', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (11, '2013-08-06 13:47:43', 2, 'en', NULL, 'Building Dreams: Cardboard City', 'Cragside', 'National Trust', 'Rothbury', 'NE65 7PX', 'Susie Kennedy', '01669 620 333', 'susie.kennedy@nationaltrust.org.uk', 'http://www.nationaltrust.org.uk/cragside/things-to-see-and-do/events/', '@NTcragside', 'https://www.facebook.com/cragside', 'Artist Events \r\n\r\nAs part of 150th anniversary at Cragside, meet the artists behind the spectacular Building Dreams: Artworks installations.  Various events are taking place throughout the Summer, so make sure you don’t miss out.\r\nCardboard City: rednile projects\r\nTuesday 20 August, 1pm – 3pm\r\nFamilies will enjoy creating their dream building with the rednile project artists using cardboard.  Suitable for ages 8 – 13.\r\n£2 per person, sign up on the day\r\n', '2013-08-20', '2013-08-20', '13:00', '15:00', '[{ "title":"rednile projects with their work; Hydraulic Colony","comment":"","size":"344.716","name":"rednile%20resized%20SM.jpg","filename":"fu_qna4rgtsa5sva63","ext":"jpg" }]', 1, 'Y', '£2.00 per person', 'Y', '£2.00 per person', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (12, '2013-08-06 14:02:41', 2, 'en', NULL, 'Building Dreams: Sailing Movement', 'Cragside', 'National Trust', 'Rothbury', 'NE65 7PX', 'Susie Kennedy', '01669 620333', 'susie.kennedy@nationaltrust.org.uk', 'http://www.nationaltrust.org.uk/cragside/things-to-see-and-do/events/', '@NTCragside', 'https://www.facebook.com/cragside', 'Artist Events \r\n\r\nAs part of 150th anniversary at Cragside, meet the artists behind the spectacular Building Dreams: Artworks installations.  Various events are taking place throughout the Summer, so make sure you don’t miss out.\r\nSailing Movement: Wolfgang Weileder \r\nSaturday 31 August\r\nWolfgang Weileder has invited Tynemouth sailing club to spend a day on Nelly’s Moss Lake beside his nautical artwork.  \r\nFree, normal admission prices apply. \r\n\r\n', '2013-08-31', '2013-08-31', '10:00', '16:00', '[{ "title":"Artist Wolfgang Weileder admiring his work; Electrical Movement in Air and Water","comment":"","size":"127.519","name":"c-2a%20resized%20web.jpg","filename":"fu_iamiiiv22qn53cb","ext":"jpg" }]', 1, 'Y', '£13.80', 'Y', '£6.90', '', '', 'Y', '£34.40', '', '');
