INSERT INTO `lime_survey_24995` VALUES (14, '2013-08-06 14:06:18', 2, 'en', NULL, 'Building Dreams: Borrowed Light', 'Cragside', 'National Trust ', 'Rothbury', 'NE65 7PX', 'Susie Kennedy', '01669 620 333', 'susie.kennedy@nationaltrust.org.uk', 'http://www.nationaltrust.org.uk/cragside/things-to-see-and-do/events/', '@NTcragside', 'https://www.facebook.com/cragside', 'Artist Events \r\n\r\nAs part of 150th anniversary at Cragside, meet the artists behind the spectacular Building Dreams: Artworks installations.  Various events are taking place throughout the Summer, so make sure you don’t miss out.\r\nBorrowed Light: Jo Coupe\r\nThursday 12 September, 7pm\r\nAn evening guided walk through Cragside House led by artist Jo Coupe whose work and thinking is deeply rooted in science and transformation.\r\n£6 per person. \r\n\r\n', '2013-09-12', '2013-09-12', '19:00', '21:00', '[{ "title":"Artist Jo Coupe with her work, Give and Take","comment":"","size":"370.107","name":"b-3a%20resized%20press.jpg","filename":"fu_exp4rt2kne7b5yi","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', '', '');
