INSERT INTO `lime_survey_24995` VALUES (20, '2013-08-09 15:15:24', 2, 'en', NULL, 'The Northumberland Village Varieties Show', 'The Northumberland Hall, Alnwick', 'The Shambles, Market Square', 'Alnwick', 'NE66 1TN', 'Chris Cross', '', 'info@chris-cross.co.uk', 'http://www.chris-cross.co.uk/villagevarieties.html', '@TheChrisCross', 'https://www.facebook.com/chriscrossentertainment', 'Local Hero, Chris Cross, is Reviving Cabaret Up North in Alnwick with \\''\\''The Northumberland Village Varieties Show\\''\\'' After Selling out the debut show in April, the Show returns to The Northumberland Hall in Alnwick on 6th September! The previous show featured Comedian Simon Donald (Co-Founder of The Viz Comic), Stephen Miller (Paralympic Multi-Gold Medalist) and lots of other diverse acts of Magic, Contortion, Unicycling, Escapology and even a Full LIVE Folk Band too! Tickets are expected to Sell Out for this show too so get them while you can! It will be a Fantastic Evening of Entertainment and there will be a Well stocked Bar & Snacks available too and the venue is GORGEOUS! \r\nTickets are ONLY £7.00 and available in person at The Alnwick Tourist Information Centre OR Online here: http://www.chris-cross.co.uk/villagevarieties.html \r\n', '2013-09-06', '2013-09-06', '7pm', '11pm', '[{ "title":"6th September Show in Alnwick!","comment":"","size":"812.655","name":"Alnwick%20Village%20Varieties%20Show%20E-Flyer.png","filename":"fu_5gvy8u46jeyt9k9","ext":"png" }]', 1, 'Y', '£7ADV/£8DOOR', 'Y', '£7ADV/£8DOOR', '', '', '', '', '', '');
