INSERT INTO `lime_survey_24995` VALUES (30, '2013-08-19 17:19:34', 2, 'en', NULL, 'Jazz under the Spire presents ... Northern Monkey Brass Band', 'Matfen Church', 'Matfen Village', 'Matfen', 'NE20 0RL', 'Mark Nash-Williams', '01661886853', 'markcvnw@hotmail.com', 'www.stamfordhamwithmatfen.org.uk/northernmonkey', '', '', '\\"A deeply funky collective of some of the finest drum and bass players in the North East, bringing that New Orleans groove to you!\\" Expect a lively, energetic show featuring original music written specially for the band, classics of the New Orleans brass band genre and well-known covers - played in a way you’ve never heard them before... \\"A good time band, but make no mistake, these guys are seriously good.\\" lance-bebopspokenhere.blogspot.co.uk ', '2013-09-12', '2013-09-12', '7.30pm', '9.30pm', '[{ "title":"","comment":"","size":"189.057","name":"IMG_1129a.jpg","filename":"fu_73tt38rupwzqysi","ext":"jpg" }]', 1, 'Y', '£10 including glass of wine or beer', 'Y', '£6', '', '', '', '', '', '');
