INSERT INTO `lime_survey_24995` VALUES (32, '2013-08-20 13:42:10', 2, 'en', NULL, 'Live Music - Farah Rigal & her Band', 'Etal Village Hall', 'Etal', 'Cornhill-on-Tweed', 'TD12 4TN', 'Helen or Steve', '01890 820566', 'hmoffitsvq@btinternet.com', 'www.ford-and-etal.co.uk', '', '', 'Farah Rigal and her Band, from France, blend Celtic, Mediterranean and Oriental sounds into a tasteful folk cocktail. Their music is a melting pot of folk, rock, roots and travel influences. Farah\\''s vocals (in English) and Patrick\\''s guitars are blended beautifully with flute, violin, bodhran and maroccan derbouka.', '2013-08-21', '2013-08-21', '7.30pm', '22.30pm', '[{ "title":"","comment":"","size":"45.873","name":"farah%20rigal%20sm.jpg","filename":"fu_dddsb7b8bykfya8","ext":"jpg" }]', 1, 'Y', '£8.00', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (33, '2013-08-20 13:53:16', 2, 'en', NULL, 'Etal Horticultural Show', 'Etal Showground', 'Ford & Etal Estates', 'Cornhill-on-Tweed', 'TD12 4TN', '', '', 'tourism@ford-and-etal.co.uk', 'www.etalflowershow.org.uk', '', '', 'The 77th Etal Flower Show takes place in the showground beside Etal village.   Gates open at 1pm, marquee open from 2pm.  Admission is £3 per adult, £1 per child, and parking is free.  This traditional country show is a day out in itself, whatever your interests.  \r\n \r\nThe horticultural marquee includes  competition vegetables, flowers, bakery itmes, jams, needlework, handicrafts and lots more.  In addition there is a Companion Dog Show with obedience, a Carousel, a Bouncy Castle, Archery, an open Quoit knowckout competition and  various stalls selling local products.  Refreshments available all day.\r\n', '2013-09-01', '2013-09-01', '1pm', '5pm', '[{ "title":"","comment":"","size":"59.716","name":"Flower%20show%20marquee%20inside.jpg","filename":"fu_npb78aenpsv24n3","ext":"jpg" }]', 1, 'Y', '£3.00', 'Y', '£1.00', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (34, '2013-08-20 14:08:44', 2, 'en', NULL, 'Towards Flodden - the Script', 'Lady Waterford Hall', 'Ford', 'Berwick-upon-Tweed', 'TD15 2QA', 'Jane', '', 'info@treadingtheborders.org.uk', 'www.treadingtheborders.org.uk', '', '', '\\"Towards Flodden\\" is a staged reading of a new work created by writers working with Treading The Borders Theatre Company.\r\n\r\n The man wants to look at the church....The woman has other ideas....And their lives will never be the same again.\r\n\r\nWeaving together hsitory and myth, religion and politics, this powerful story expores the emotional impact of the battle both then and now.  \r\n\r\n \\"Towards Flodden\\" is more than a commemoration of the 500th Anniversary of the Battle of Flodden: it is a story of who we are...\r\n\r\n Tickets cost £6.00 and are available from www.borderevents.com \r\n\r\n Treading the Borders Theatre Company is a Scottish Charitable Incorporated Organisation SCO42658 and is funded by Creative Scotland and Scottish Borders Council.', '2013-09-07', '2013-09-07', '7.30pm ', '10pm', '[{ "title":"","comment":"","size":"25.419","name":"Towards%20flodden.jpg","filename":"fu_yaqbdkchjw69dcs","ext":"jpg" }]', 1, 'Y', '£6.00', '', '', '', '', '', '', '', '');
