INSERT INTO `lime_survey_24995` VALUES (36, '2013-08-20 14:15:12', 2, 'en', NULL, 'Flower, Arts & Craft Festival', 'Crookham URC & Village Hall', 'Crookham', 'Cornhill-on-Tweed', 'TD12 4SY', '', '', 'tourism@ford-and-etal.co.uk', '', '', '', 'This festival is well worth a visit - and entry to all the events is free! Part of the Flodden 1513 project, the festival takes place at the United Reformed Church in Crookham and in Crookham Village Hall.\r\n\r\nAT THE UNITED REFORMED CHURCH: a flower festival on the theme of Peace & Reconciliation.  The newly constructed garden on the same theme will also be open.\r\n\r\nAT CROOKHAM VILLAGE HALL:  artwork and crafts by talented local people - some of the art and crafts will be for sale.  Refreshments will also be available.', '2013-08-24', '2013-08-26', '10.00am', '4pm', '[]', 0, '', '', '', '', '', '', '', '', 'Y', 'Donations welcome');
INSERT INTO `lime_survey_24995` VALUES (37, '2013-08-20 14:20:23', 2, 'en', NULL, 'Pop up Summer Market', 'Etal Village Hall', 'Etal', 'Cornhill-on-Tweed', 'TD12 4TN', 'Sue', '07970 697433', 'tourism@ford-and-etal.co.uk', 'www.st-abbs-market.com', '@StAbbsMarket', '', 'Great local produce including: fresh fish, rare breed pork and wild venison products, and other food delights.  Also quality arts and crafts, and gifts for everyone.  Well worth a visit!', '2013-08-22', '2013-08-22', '11am', '3pm', '[]', 0, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_24995` VALUES (38, '2013-08-20 14:27:30', 2, 'en', NULL, 'Live Music - O\\''Hooley & Tidow', 'Etal Village Hall', 'Ford & Etal Estates', 'Cornhill-on-Tweed', 'TD12 4TN', 'Helen  or Steve', '01890 820566', 'hmoffitsvq@btinternet.com', 'http://ohooleyandtidow.com/', '', '', 'Hailed as the best act of the prestigious Cambridge Folk Festival 2012 by The Guardian and finalists in the 2013 BBC Radio 2 Folk Awards for \\''Best Duo\\''; the multi award-winning Belinda O\\''Hooley (Rachel Unthank & The Winterset, Nic Jones Trio, Jackie Oates) and Heidi Tidow are now one of the most popular and unique acts on the contemporary folk scene. Their latest album \\''The Fragile\\'' garnered 4 star reviews from The Guardian, Mojo, Uncut and Songlines, and was described by The Independent as a \\''must-buy\\''. Their 2010 debut album \\''Silent June\\'' received widespread acclaim and was listed in Mojo Magazine\\''s top 10 Folk Albums of 2010. The duo\\''s beautifully unusual songs touch on every human emotion; drawing on love and loss, dark and humorous folk tales and everything from the invisibility of the elderly, through to ecology, rumour-mongering and the global economy. Championed by folk icon Nic Jones and 6 Music\\''s Cerys Matthews; expect an irresistible blend of thought-provoking songs, intricate harmonies and striking piano-led arrangements.', '2013-09-14', '2013-09-14', '7.30pm', '7.30pm', '[]', 0, 'Y', '£10.00', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (39, '2013-08-20 14:31:44', 2, 'en', NULL, 'Soddin\\'' Flodden', 'Lady Waterford Hall', 'Ford Village', 'Berwick-upon-Tweed', 'TD15 2QA', '', '', 'tourism@ford-and-etal.co.uk', '', '', '', ' 1513, Flodden Field. The scene of Scotland\\''s worst defeat by the English. Who was James IV, the man who led his countrymen on that sorrowful day? Was he just the fourth monarch from a family with little imagination regarding Christian names, or was he a heroic, talented, charismatic king who developed a close attachment to beautiful women, impressive cannons, big ships and metal underwear?\r\n\r\nWith words, music and nonsense, Ideoms (John Nichol, Hilary Bell and Lucy Cowan) will answer these questions and eradicate the 499-year-old inferiority complex... provided nobody objects.', '2013-09-21', '2013-08-21', '7.30pm', '10pm', '[{ "title":"","comment":"","size":"77.028","name":"soddin%20flodden.jpg","filename":"fu_guhcwdnw3846xvn","ext":"jpg" }]', 1, 'Y', '', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (40, '2013-08-20 14:37:19', 2, 'en', NULL, 'Ford Christmas Market', 'Lady Waterford Hall', 'Ford Village', 'Berwick-upon-Tweed', 'TD15 2QA', '', '01890 820338', 'tourism@ford-and-etal.co.uk', 'www.ford-and-etal.co.uk', '', '', 'This annual event is so much more than a market - it\\''s a real family day out.  With over 30 stalls selling a huge variety of local food and crafts, all under cover of a marquee and inside the stunning Lady Waterford Hall, this is an ideal opportunity to do all your Christmas shopping.\r\n\r\n \r\n\r\nWith a selection of music from local performers playing throughout the day, Santa arriving in style, an array of hot, seasonal refreshments, free parking and more besides this event should not be missed.\r\n', '2013-12-01', '2013-12-01', '11.00am', '3.30pm', '[{ "title":"","comment":"","size":"150.536","name":"santa%2C%20elves%20and%20horse.jpg","filename":"fu_83m94gs225u7y95","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_24995` VALUES (41, '2013-08-20 14:46:37', 2, 'en', NULL, 'Santa Specials', 'Heatherslaw Light Railway', 'Ford & Etal Estates', 'Cornhill-on-Tweed', 'TD12 4TJ', 'Paul Smith', '01890 820317', 'info@heatherslawlightrailway.co.uk', 'www.heatherslawlightrailway.co.uk', '', '', 'Santa returns to Heatherslaw!  Train Ride, Santa\\''s Grotto, refreshments and mince pies.  Steam train rides as 12 noon and 1pm.  Every Saturday in December leading up to Christmas, also Sunday 22nd December.  Tra', '2013-12-01', '2013-12-22', '12 noon', '1pm', '[{ "title":"","comment":"","size":"945.049","name":"bunty%20and%20blue%20carriages.jpg","filename":"fu_u865kpxn72r9hpp","ext":"jpg" }]', 1, 'Y', '£8.00', 'Y', '£8.00', 'Y', '£8.00', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (42, '2013-08-20 14:50:33', 2, 'en', NULL, 'Brave Runner', 'starting at Etal', 'Ford & Etal Estates', 'Cornhill-on-Tweed', 'TD12 4TN', '', '', 'tourism@ford-and-etal.co.uk', 'http://www.braverunner.com/ ', '', '', 'Raise your Standard running against the opposition at the world\\''s first Contra-Circumnavigation Trail Running Race. After party too!', '2013-10-12', '2013-08-12', '4.30pm', 'midnight', '[]', 0, 'Y', '£31/£30', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (43, '2013-08-20 14:55:14', 2, 'en', NULL, 'Hallowe\\''en', 'Ford & Etal Estates', 'Ford, Etal & Heatherslaw', 'Cornhill-on-Tweed', 'TD12 4TJ', '', '01890 820338', 'tourism@ford-and-etal.co,uk', 'www.ford-and-etal.co.uk', '@FordandEtal', '', 'Family fun with traditional hallowe\\''en activities including pumpkin carving,spooky food, dressing up,scary caricature sketching, the famous Ford & Etal Scarycrow trail and much more', '2013-10-31', '2013-10-31', '10.00am', '4pm', '[{ "title":"","comment":"","size":"102.747","name":"pumpkins%202.jpg","filename":"fu_dbu8ywjzp2yhc9v","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', 'Y', 'some venues do charge admission - check website for details');
INSERT INTO `lime_survey_24995` VALUES (44, '2013-08-21 11:14:33', 2, 'en', NULL, 'Viaduct Views - Open Day at Kielder Castle', 'Kielder Castle', 'Kielder Water & Forest Park', 'Kielder', 'NE48 1ER', 'Jo Scott', '01830 520 065', 'jo@joscott-heritage.co.uk', 'www.visitkielder.com/ourhistory', '', 'www.facebook.com/groups/KielderHistoryPorject/', 'Kielder Viaduct – landmark, viewpoint, talking point\r\nCome along to this free event in Kielder Castle\\''s gallery to discover Kielder Viaduct and village stories, see pictures of the past and share your memories of this remarkable structure.  \r\nDrop in any time between 11am and 4pm to:\r\n\r\n•	Browse old and new images of the viaduct, railway and community\r\n•	Listen to recordings of local people reminiscing about life in the valley\r\n•	Share your stories, memories or thoughts about Kielder’s past\r\n•	Bring along your favourite Kielder pictures or objects \r\n•	Tell us how you’d like Kielder’s stories and heritage to be shared in the future\r\n•	Find out how to get involved in this exciting project, have fun and learn new skills\r\n\r\nThis event is part of an exciting new project to celebrate and share Kielder’s social, agricultural and industrial history and to gather its stories into one fascinating collection for local people and visitors to enjoy.\r\n\r\nThe Kielder Viaduct Heritage Project is a partnership between Kielder Water & Forest Park Development Trust, Kielder History Group, Northumberland & Newcastle Society, The Heritage Centre at Bellingham and the community.  We’re working together to help people discover, learn \r\nmore about and share Kielder’s heritage.', '2013-09-01', '2013-09-01', '11am', '4pm', '[{ "title":"Kielder Viaduct 1953 (EE Smith)","comment":"","size":"197.808","name":"P4_62_100cleaned%20-%20for%20web.jpg","filename":"fu_gkqrbnmdmthjdsw","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_24995` VALUES (45, '2013-08-21 16:28:13', 2, 'en', NULL, 'Richard Hobson 1945-2004', 'Robinson-Gay Art Gallery', '3a Market Street', 'Hexham', 'NE46 3NS', 'Sarah Robinson-Gay', '01434 601972', 'robinson-gay@fsmail.net', 'www.northumberlandartgallery.co.uk', '@RobinsonGay', 'www.facebook.com/pages/Robinson-Gay-Art-Gallery', 'With kind permission of Pat Hobson, Robinson-Gay are delighted to be exhibiting this collection of Richard Hobson\\''s work. Richard sadly died in 2004 but his work has become synonymous with the industrial landscape of the North East; a testament to our heritage which has long since disappeared. At the time when he was painting, Richard never intended to create such a social record. On appreciating the legacy of his work, it is without doubt that these pieces Richard created are of historical significance.\r\nFarming; marts and markets; mining and collieries; ship building, fishing and seascapes were all intricately studied, catalogued and expressively captured in this evocative collection. He was drawn to such places for inspiration and portrayed beauty in often bleak and challenging settings and weather.\r\nAs a well respected conservator at the Bowes Museum for 31 years and as an artist, Richard created a rich and diverse record of North Eastern life. He painstakingly restored the Durham Miners Gala Banners and many paintings which line the walls of the Bowes Museum. He was a diarist of his time, carefully detailing the slow decline of our industry in the North East in a powerful, expressive and meticulous manner. Many of his signature shipping pieces are now held in private collections but this exhibition portrays the outstretched beaches and landscapes around the North East. Richard found beauty in a broken pipe or disused tank trap left behind during World War II. Monolithic power stations, colliery workings and ship building cranes are all captured in these large monotypes and watercolours.', '2013-10-08', '2013-11-09', '10.30', '5', '[{ "title":"North Shields Fish Quay","comment":"Copyright Pat Hobson","size":"65.445","name":"North%20Shields%20Fish%20Quay.jpg","filename":"fu_dqu4vp4abskj25d","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', 'Y', '');
