INSERT INTO `lime_survey_24995` VALUES (49, '2013-08-25 13:26:41', 2, 'en', NULL, 'Halloween Spooktacular', 'Whitehouse Farm Centre', 'North Whitehouse Farm', 'Morpeth', 'NE61 6AW', '', '01670 789998', 'whitehousefarmcnetre@tiscali.co.uk', 'whitehousefarmcentre.co.uk', '', '', 'Are you brave enough to visit Whitehouse Farm Centre near Morpeth  from 26th Oct  until 3rd  Nov  during their  hair raising  Halloween Spooktacular Event ?\r\nEvery day in the Grim Grotto  budding witches & wizards can cast a spell at Magic Merlin’s School & join in the Halloween themed games with prizes to be won. Pumpkins can be bought and made into lanterns with the help of Penny Pumpkin. Then if you dare, creep through the Walkway of Terror! Weave your way around  the Spider’s Lair, Bat Chamber & Chop Shop but don’t  disturb  the ghostly spirits  in the spooky sitting room & grave yard. (Be prepared for one or two surprises along the way!! ) See if you can find  some of the  witches from Flying School  as they have lost their way around the farm, plus you may bump into some odd characters as the staff get dressed up too.!! Come in Fancy Dress and take part in the  Daily Monster Parade & you could win a  gift voucher for best costume. See the magnificent Birds of Prey  & get close to some critters in the Beastie Shows. If Halloween isn’t your thing, then there’s still lots of cute & friendly animals to feed, hold & stroke as well as the Meerkat Feed & Talk, soft play barn, Frisbee golf, racing cars, trampolines, panning for gold, adventure playground and lots more. Whatever the weather a spine-tingling day is guaranteed!  Open daily 10am until 5pm.For prices & more details see  www.whitehousefarmcentre.co.uk                      \r\n', '2013-10-26', '2013-11-03', '10am', '5pm', '', 0, 'Y', '£9.50', 'Y', '£8.50  2 - 16yrs', 'Y', '£8.50', 'Y', '£32.50 & £40.50', '', '');
