INSERT INTO `lime_survey_24995` VALUES (52, '2013-08-29 13:26:41', 2, 'en', NULL, 'Belford Heritage Weekend', 'Belford St Mary\\''s Parish Church', 'Market Square, ', 'Belford', 'NE70 7NE', 'Lynda Humble', '', 'l.humble@btinternet.com', 'www.belfordnorthumberland.co.uk', '', '', ' St Mary\\''s Parish Church Belford, \\"Heritage Weekend\\".  Friday 13th 7.00 pm Quiz Night with ham and pease pudding stottie £5.  Saturday 14th Heritage Displays and Demonstrations 10.30 - 4.00 including stained glass, caligraphy, basket making, quilting, spinning, flower arranging, northumbrian pipes. Refreshment throughout the day (donation entry). Sunday 15th 2.00 Heritage Concert and afternoon tea.  (donation entry).  ', '2013-09-13', '2013-09-15', 'Sat 10.30      Sun 2.00  ', '4.00 pm', '[]', 0, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_24995` VALUES (53, '2013-08-29 20:27:36', 2, 'en', NULL, 'Kielder Challenge Walk', 'Hawkhope Car Park', 'Kielder Reservoir', 'Kielder', 'NE48 1BB', 'Shepherds Walks', '01669 621044', 'info@shepherdswalks.co.uk', 'www.kielderwalking.co.uk', '@WalksNorthEast', 'https://www.facebook.com/groups/139007189515222/?fref=ts', 'The Kielder Challenge Walk has become one of the most popular challenge walks in Northumberland over the past few years.\r\n\r\nThe route is easy to navigate and is great under foot so is suitable for runners as well as walkers and what better location. The route encircled Kielder Reservoir.\r\n\r\nAfter checking in on the day you are on your way along the 25.3 mile route. Initially you go along the remote North Shore passing through checkpoints on your way.\r\n\r\nWater and snacks are available on route and a support vehicle is on hand all day, to pick those up who drop out. Emergency first aid is on site all day, so you can relax and enjoy a great days walking.\r\n\r\nPeople perceive it is a flat route, but the Kielder Challenge Walk goes up (and down) 1,500 feet over the 25.3 miles.', '2013-09-07', '2013-09-07', '8.00', '19.00', '[{ "title":"Kielder Challenge","comment":"","size":"262.966","name":"S9.jpg","filename":"fu_i6tna4p59tj8dwh","ext":"jpg" }]', 1, 'Y', '27.50', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (54, '2013-08-29 20:32:56', 2, 'en', NULL, 'Berwick Walking Festival', 'Berwick upon Tweed', 'Berwick', 'Berwick', 'TD15 1BN', 'Shepherds Walks', '01669 621044', 'info@shepherdswalks.co.uk', 'www.berwickwalking.co.uk', '@BerwickWalking', 'https://www.facebook.com/berwickwalking', 'The first Berwick Walking Festival takes place over the first weekend in April.\r\n\r\nThe programme includes such highlights as –\r\n\r\n\r\n- Town Wall Walk - details will follow\r\n\r\n- Holy Island to Berwick – linear walk - see below\r\n\r\n- Nordic Walking taster sessions - see below\r\n\r\n- Nordic Walk - details will follow\r\n\r\n- Geology Walk\r\n\r\n- Berwick to St Abbs – linear walk - details will follow\r\n\r\n- Walk up the Tweed – linear walk - details will follow\r\nand lots, lots more.\r\n\r\nI very much hope you can join us.', '2014-04-05', '2014-04-07', '9.30', '17.00', '[{ "title":"Berwick Walking Festival","comment":"","size":"43.996","name":"488e2f11a7a6c924df146079ee95880a.jpg","filename":"fu_ra54jsuuciui7rw","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', '', '');
