INSERT INTO `lime_survey_24995` VALUES (56, '2013-09-01 13:30:19', 2, 'en', NULL, 'Heritage Open Days : The Hearth Horsley', 'The Hearth', 'Main Road', 'Horsley', 'NE15 0NT', 'Jo Bourne', '01661 852545', 'office@thehearth.co.uk', 'http://www.thehearth.co.uk/', '@TheHearthArt', 'https://www.facebook.com/pages/The-Hearth-Arts-Centre-Caf%C3%A9/163744190350831', 'Part of Heritage Open Days National Partnership. \r\n\r\nDiscover Horsley through the life of Ann and Joseph Parker, early 1850s residents of this small village. Explore the scent, sound and local history of the North East area through actors, displays and fun family activity. This unique, free, opportunity to learn more about Horsley\\''s local history through scent, sound and participation has been created for families to enjoy as part of the Heritage Open Days National Partnership.\r\n\r\nAlso don\\''t forget to enter The Hearth\\''s A Very Victorian Smell competition and you could win one of 3 exciting prizes, and have the chance to see your work displayed during the Heritage Open Days weekend. \r\n\r\nCOMPETITION : COMPETITION: Read Joseph Parker\\''s story here \r\nhttp://www.thehearth.co.uk/wb/pages/whats-on/heritage-competition.php \r\nthen send your entries by email, post or in person.\r\n', '2013-09-14', '2013-09-15', '11am', '3pm', '[{ "title":"The Hearth Horsley","comment":"","size":"71.266","name":"HEARTH.jpg","filename":"fu_edikdsqsfu2m6x9","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_24995` VALUES (57, '2013-09-01 23:59:52', 2, 'en', NULL, 'Blyth Paralympic Legacy', 'Briardale Community Centre', 'Briardale Road', 'Blyth', 'NE24 5AN', 'Alan Hoyle', '07596939159', 'alan@aspire2achieve.org.uk', 'http://www.aspire2achieve.org.uk', '', '', 'This September Aspire 2 Achieve are running two Olympic and Paralympic Legacy events. The Paralympic Legacy event is the first to take place on September 14th, 10am till 3pm at the Briardale Community Centre in Blyth, whilst the Olympic Legacy event is taking place on September 29th, 9am till 3pm at Blyth Market Square.\r\n\r\nThe Olympic Values of Respect, Friendship, Determination, Courage and Equality will run throughout each day as it takes more than just physical skills to be a successful sportsman or woman, these values can be applied to education and everyday lives, along with sport itself.\r\n\r\nYoung people from around the region will take part in ten different sporting events, the variety of sports were chosen carefully to present the participants with a number of different challenges throughout the day whilst allowing them to try out games which they might not have played in the past.\r\n\r\nThe variety of sports were chosen carefully to present the participants with a number of different challenges throughout the day whilst allowing them to try out games which they might not have played in the past.\r\n\r\nA number of different organisation\\''s will be taking part with delivering the sports with the aim to deliver the best possible coaching for each event to the participants.', '2013-09-14', '2013-09-14', '10am', '3pm', '[{ "title":"","comment":"","size":"774.951","name":"Olympic%20Legacy%20Poster.jpg","filename":"fu_uev5v8hym3j2txs","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_24995` VALUES (58, '2013-09-02 07:53:18', 2, 'en', NULL, 'Northumberland Coastal Challenge Walk', 'Alnmouth', 'Alnmouth Football Club', 'Alnmouth', 'NE66 3PX', 'Jon Monks', '01669 621044', 'info@shepherdswalks.co.uk', 'http://shepherdswalks.co.uk/events/northumberland_coastal_challenge_walk', '', 'https://www.facebook.com/groups/334036096628610/', 'The Northumberland Coastal Challenge walk takes place on the first May Bank Holiday Monday.\r\n\r\nThis 26 mile linear walk covers the fantastic Northumberland Coastal line from just North of Bamburgh to Alnmouth.\r\n\r\nAfter checking in on the morning of the walk in Alnmouth, transport is provided to the starting point near to Bamburgh. Participants then follow the Northumberland Coastal path back to Alnmouth.\r\n\r\nSupport vehicles will be on standby, water stations, and emergency first aid cover will all be present on the day. Every participant will receive a goody bag at the end of a great days walking.\r\n\r\nPlease book early as places are limited.', '2014-05-05', '2014-05-05', '8.00', '17.00', '[{ "title":"Coastal Challenge Walk","comment":"","size":"88.733","name":"46.jpg","filename":"fu_jh5p7nbjs286n5m","ext":"jpg" }]', 1, 'Y', '27.50', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (59, '2013-09-02 07:58:30', 2, 'en', NULL, 'Rothbury Walking Festival', 'Rothbury', 'Coquetdale Centre', 'Rothbury', 'NE65 7UP', 'Jon Monks', '01669 621044', 'info@shepherdswalks.co.uk', 'http://shepherdswalks.co.uk/events/rothbury_walking_festival', '@rothburywalkfes', 'https://www.facebook.com/RothburyWalkingFestival', 'The sixth Rothbury and Coquetdale Midsummer Walking Festival. The premier walking festival in Northumberland.\r\n\r\nWith 18 walks over the nine days there is something for everybody.\r\n\r\nAll the walks are taking place in the best walking landscape that Northumberland has to offer, Rothbury and Coquetdale and this year a little further afield.\r\n\r\nIt would be great if you could join us on one or a number of walks at the 2014 Rothbury Walking Festival.', '2014-06-21', '2014-06-29', '9.00', '17.00', '[{ "title":"Rothbury Walking Festival","comment":"","size":"92.136","name":"8.jpg","filename":"fu_8dwbm8deqqs2frz","ext":"jpg" }]', 1, 'Y', '', 'Y', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (60, '2013-09-02 08:03:43', 2, 'en', NULL, 'Cragside Challenge Walk', 'Cragside, Rothbury', 'Cragside', 'Rothbury', 'NE65 7PX', 'Shepherds Walks', '01669 621044', 'info@shepherdswalks.co.uk', 'http://shepherdswalks.co.uk/events/cragside_challenge_walk_-_self_guided_or_guided', '@shepherdswalks', 'https://www.facebook.com/shepwalks', 'Shepherds Walks has again teamed up with the National Trust to put on the fourth 13 mile Cragside Challenge walk/ run.\r\n\r\nStarting at Cragside (free entry included in entry fee), the former home of Lord Armstrong this 13 mile walk will pass through this superb National Trust estate before following the River Coquet to Rothbury. From here the route rises up past Lordenshaws Iron Age Hillfort (Checkpoint 1) to Dove Crag, the highpoint of the walk.\r\n\r\nThe route then drops down passing Tosson Lime Kiln (Checkpoint 2) to the small village of Thropton, before crossing the River Coquet.\r\nThe route the rises up to the Cragside Carriageway drive which is the picturesque landscape to the north of Rothbury. You will then drop down to the stunning finish on the banks of Tumbleton Lake.\r\n\r\nThe route is good under foot. Way markers will also be in place to make for easy navigation.\r\n\r\nAs you complete the 13 miles challenge walk at your own pace you will pass through checkpoints and snacks and drinks will be available on route.\r\n\r\nPlease do book early to avoid disappointment.', '2014-06-28', '2014-06-28', '9.00', '17.00', '[{ "title":"Cragside Challenge Walk","comment":"","size":"96.081","name":"65.jpg","filename":"fu_fy5765javcacs3h","ext":"jpg" }]', 1, 'Y', '22.50', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_24995` VALUES (61, '2013-09-02 08:11:20', 2, 'en', NULL, 'St Cuthbert\\''s Way Challenge Walk', 'Wooler', 'Wooler Mart', 'Wooler', 'NE71 6SL', 'Shepherds Walks', '01669 621044', 'info@shepherdswalks.co.uk', 'http://shepherdswalks.co.uk/events/st_cuthberts_way_challenge_walk_-_self_guided_or_guided', '@shepherdswalks', 'https://www.facebook.com/shepwalks', 'This 19.5 mile cross border challenge takes in the best section of St Cuthbert’s Way as you start walking in Scotland and finish in England.\r\n\r\nAfter registration in Wooler you will be transferred up to Morbattle to start the walk. You initially climb Grubbit Law, follow the ridge over Wideopen Hill (the highest point on St Cuthbert’s Way at 368m) and pass over Cookedshaws Hill before dropping down to Town Yetholm. This section of the challenge walk is truly stunning with the Cheviots to the South and the Scottish Borders to the north.\r\n\r\nAfter leaving Yetholm you then have a climb up to the border ridge where you pass from Scotland into England before dropping down to Hethpool. \r\n\r\nFrom Hethpool the route passes just south of Kirknewton as you pass in between ancient hill settlements in such a picturesque but rugged landscape as you make your way back to Wooler.\r\n\r\nThroughout the challenge walk you will pass through checkpoints with water available on all of them and snacks on one. Emergency first aid is provided and if you drop out during the walk we will take you back to Wooler.\r\n\r\nThe total ascent on this walk is - 3333 feet (1016m)\r\n\r\nA truly special challenge walk passing along the best section of St Cuthbert’s Way as you make your way from Scotland back into England before receiving a well deserved welcome back after completing a true challenge.', '2014-08-09', '2014-08-09', '8.00', '18.00', '[{ "title":"St Cuthbert''s Way Challenge Walk","comment":"","size":"111.028","name":"76.jpg","filename":"fu_nfcwchni3kyx6is","ext":"jpg" }]', 1, 'Y', '27.50', '', '', '', '', '', '', '', '');
