INSERT INTO `lime_survey_25774` VALUES (5, '2013-08-15 15:44:53', 2, 'en', NULL, 'Newbiggin Sprint Triathlon', 'Newbiggin Maritime Centre', 'Church Point', 'Newbiggin by the Sea', 'NE64 6DB', 'Vo2Max ', '', 'info@vo2maxracingevents.co.uk', 'www.vo2maxracingevents.co.uk', 'https://twitter.com/#!/VO2MaxRacing', 'http://www.facebook.com/pages/VO2Max-Racing-Events', 'Now in its fifth year, the Newbiggin triathlon is traditionally the North Region\\''s final open water triathlon of the season, and we’re pleased to announce that the race is a qualifying event for the 2014 ETU European Sprint Distance Championships to be held in Kitzbuhel, Austria. With a packed field and separate male and female waves, there should be some great racing at the Bay!\r\n\r\nThis event is the jewel in the crown for triathlon in the region, with a unique location and a reputation for providing a European style crowd creating plenty of noisy support to help you make it to the finish with good humour and a smile. You will not be disappointed... you have to be there to take in the finish line atmosphere, it is electric.\r\n\r\nNewbiggin-by-the-Sea is a beautiful Northumberland coastal fishing village approximately 14 miles North of Newcastle upon Tyne, but don’t tell anyone as it is our secret! The one-lap swim takes place in the beautiful bay, sheltered by the breakwater upon which stand the sculpted forms of The Couple. A 3-lap bike on part-closed roads gives spectators plenty of opportunity to watch the race develop, while the 2 lap run takes in the promenade and always attracts a large and vocal crowd.', '2013-09-01', '2013-09-01', '10:00', '13:00', '', 0, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_61378` VALUES (2, '2013-08-14 11:36:50', 2, 'en', NULL, 'Lindisfarne Week', 'St Thomas Church Stanhope', 'Market Place', 'Stanhope', 'DL13 2UP', 'June Crosby', '01388 526952 ', 'zilecave@hotmail.co.uk', '', '', '', '7 days of fun-filled experiences to celebrate the visit of the Gospels to Durham City this summer.  A programme of exhibition, talks and artistic workshops depicting the life and times of the Lindisfarne Gospels, all in the wonderful setting of St. Thomas’ Church and Church Hall.  Behind the Church Hall in Front Street, there will be a marquee housing workshops, led by professional artists, Sue Abel (textiles), Ellie Langley (weaving), Charlie Allen (ceramics), Ruth Thompson (basket making) and Paul Martin (woodwork). Book your place and come along and join in. Workshops are limited so book early! ', '2013-08-19', '2013-08-25', '10:00', '16:00', '', 0, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_61378` VALUES (3, '2013-08-14 11:41:02', 2, 'en', NULL, 'Liturgical Organ Tour', 'St Thomas\\''s Church Stanhope', 'Market Place ', 'Stanhope', 'DL13 2UP', 'Michael Grave  ', '07870 520404 ', '.', '', '', '', 'The J&M Duo (Michael Grave, Organ & Jean Grave Mezzo-Soprano) perform organ music with sung chorales seasons of the Church year. Interspersed with Anglo-Saxon readings read by Rev Susan Kent.Tickets £5 at door include refreshments. In aid of Choir funds.', '2013-08-22', '2013-08-22', '19:30', '21:30', '', 0, 'Y', '£5', '', '', '', '', '', '', '', '');
INSERT INTO `lime_survey_61378` VALUES (5, '2013-08-14 12:13:33', 2, 'en', NULL, '#geordiebees Family Barbecue', 'St John the Baptist Church, Newcastle', 'Grainger Street', 'Newcastle upon Tyne', 'NE1 5JS', 'Revd Dr Nicholas Buxton', '', 'buxton.nicholas@gmail.com', 'www.stjohnthebaptistnewcastle.co.uk', '@johnthebaptizer', 'http://www.facebook.com/events/434260026666844/', 'St John the Baptist\\''s church (located in the heart of Newcastle upon Tyne, on Grainger Street) are opening up their beautiful garden for a very special FREE event as part of EAT! Festival. \r\nMarco Pierre White\\''s Steakhouse & Grill are sending over their finest chef to BBQ some culinary delights as part of an afternoon of free music and entertainment. \r\nSt John\\''s would like to invite the local community to come over and enjoy the sunshine (finger\\''s crossed!), live music, circus performers and Street Scientists.\r\nAll proceeds will go towards St John the Baptist\\''s Bee Keeping project and work with homeless adults. \r\nBurandunga - 2.45pm\r\nKennedy Banda 2.00pm\r\nMush 1.15pm \r\nShipcote & Friends 12.30pm\r\nGilded Thieves 11.45am\r\nAll Drummed Up - 11.00am\r\nPlus circus tricks from Luna Tricks and Mad Science from Streetscientists all day! ', '2013-09-07', '2013-09-07', '12:00', '15:00', '[{ "title":"","comment":"","size":"56.576","name":"BarBee.jpg","filename":"fu_ngs9qxrswmeb7zm","ext":"jpg" }]', 1, '', '', '', '', '', '', '', '', 'Y', '');
INSERT INTO `lime_survey_61378` VALUES (6, '2013-08-23 23:15:57', 2, 'en', NULL, 'Jazz Under the Spire presents ... Northern Monkey Brass Band', 'Holy Trinity Church, Matfen', 'Matfen', 'Matfen', 'NE20 0RH', 'Mark Nash-Williams', '01661 886853', 'vicar@stamfordhamwithmatfen.org.uk', 'www.stamfordhamwithmatfen.org.uk/northernmonkey', '', '', '\\"A deeply funky collective of the finest drum and brass players in the North East, bringing that New Orleans groove to you\\".\r\n\r\nA lively, energetic show, featuring original music written specially for the band, classics of the New Orleans brass band genre and well known covers – in a way you’ve never heard them...', '2013-09-12', '2013-09-12', '7.30pm', '9.30pm', '[{ "title":"","comment":"","size":"189.057","name":"IMG_1129a.jpg","filename":"fu_tvehisqvn38rkhd","ext":"jpg" }]', 1, 'Y', '£10 including glass of wine/beeer', 'Y', '£6', '', '', '', '', '', '');
INSERT INTO `lime_survey_61378` VALUES (7, '2013-09-02 12:45:59', 2, 'en', NULL, 'Mindfulness Walks', 'St Michael and All Angels Parish Church, Witton Gilbert, Durham', 'Coach Lane, Witton Gilbert', 'Durham', 'DH7 6SU', 'Pam Barmby', '07502 471 522', 'breathingspaceduurham@gmail.com', 'http://wittongilbert.durhamnorthteam.org/breathingspace/', '', 'WittonGilbertStMichael', 'Leave your worries behind on this peaceful, contemplative\r\nguided  meditation walk through the beautiful woodland of Witton Dene and surrounding area. By learning how to create your own breathing space Quiet, it\\''s the perfect way to relax, chill out and learn to appreciate ourselves in the beautiful surroundings of St Michael and All Angels church and Witton Dene. Join us on the 4th of each month. Come weather prepared. Opportunities to chat and have refreshments afterwards.\r\n', '2013-09-04', '2013-09-04', '10am', '11.30am', '[]', 0, '', '', '', '', '', '', '', '', 'Y', '');
