INSERT INTO `lime_survey_62863` VALUES (86, '2013-08-23 16:18:47', 11, 'en', '2013-08-23 16:18:47', '2013-08-23 15:55:23', 'http://survey.ntads.co.uk/index.php?sid=62863&lang=en', 'A3', '', '', '', '', '', 'Y', '', '', '', '', '', '', '12', '', NULL, 'A1', '', NULL, 'A4', 'A5', 'None - prefer Northumberland', NULL, '7 on this visit', '', NULL, 'Y', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', 'Northumberland', NULL, NULL, NULL, 'A1', '', '', '', '', '', '', '', '', '', '', '', 'taxi', '', '', 'Y', '', '', '', 'Y', 'Y', 'Y', '', '', 'Y', '', '', 'Y', '', '', '', 'Y', 'Y', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', 'Maybe Lindisfarne, Bamburgh', 'Y', 'Y', '', '', '', 'Y', '', '', '', '', '', 'Daily Mail, Daily Express', 'A2', 'Y', 'The peace, quiet, relaxation, beaches, pottering places.', 'Just good weather.', 'A2', 'A7', 'A2', 'A3', 'A3', 'A1', 'A3', 'A2', 'A2', 'A7', 'A2', 'A2', 'A3', 'A2', 'A1', 'A1', 'A2', 'A2', '10', NULL, 'A1', 'A1', 'A1', 'A1', 'A2', 'A3', 'A2', 'A1', 'A2', 'A1', 'N', 'A6', 'A3', 'Y', 'Y', 'Northumberland to me is a place to relax, enjoy the scenery, especially the beaches, the one at Spittal is superb.  The shops although many are closing down are easy to walk around, the staff friendly and helpful, especially in Berwick.  The bus services are excellent and the drivers helpful especially when going via the tourist attractions.  What is there to dislike about Northumberland, hopefully by the end of this year we will have been 6 times this year and wish it was more!!!', 'Jersey, Channel Islands still classed at UK.\r\nBridlington, Filey, Cleethorpes, Edinburgh, Hull', 'A4', '', 2, 'A6', 70, '', 'over £150', '', 'over £300', 'approx  £80', '', 2, 'N', '', 'Y', 'J Pinner', '01405 815449', 'PinnerJersey@aol.com');
