INSERT INTO `lime_survey_62863` VALUES (160, NULL, 8, 'en', '2013-08-23 19:44:47', '2013-08-23 19:07:34', 'http://survey.ntads.co.uk/index.php?sid=62863&lang=en', 'A3', '', '', '', '', '', 'Y', '', '', '', '', '', '', '-oth-', 'used same cottage last year', NULL, 'A1', '', NULL, 'A5', 'A5', 'Scotland', NULL, ' 7 in February 2013, 14 in june/July 2013', '', NULL, 'Y', '', '', '', '', 'Y', 'Y', '', '', '', 'Y', '', 'Y', 'Y', '', '', '', 'Visit at least once a year. Also see stand at Birdfair in Rutland.', 'Lots of little leaflets we pick up on our travels. ', '', 'We call in at Seahouses, Alnwick, Wooler,Haltwhistle. Miss the old National Park Visitor centres at Rothbury and Ingram.  We also pick things up at places like Otterburn Mill, and Sainsburys at Alnwick. Also at pubs, etc. Our cottage has a wonderful lot of info.', 'I read all my emails from Visit Northumberland. Also use place own websites, such as Howick Hall, National Trust', '-oth-', 'We visit at least once a year because we love the county. It is the most beautiful and varied place we have in England, and there are so many places where you can go and just get away from the hustle and busttle of life. We also love the locals. Always friendly, helpful, and just plain nice. ', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', 'Y', '', '', '', 'Y', 'Y', '', 'Y', '', '', '', '', '', 'Y', '', '', 'Y', '', '', 'Bird watching and wildlife,National Trust', '', '', 'Y', '', 'Y', '', '', '', '', '', '', '', 'Y', '', '', 'Birding and wildlife, National Trust', 'Wallington, Cragside, Farne Islands with Billy Shiels, Alnwick Gardens (although may stop going there because it is ridiculously expensive, and you even have to pay separately to park), Howick Hall, Harthope valley, Coquetdale, Breamish valley, Stag Rocks, Budle bay, Haltwhistle Burn, The Pinnacle fish & chips at Seahouses.', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'National Trust, Sainsburys, ', 'Visit Northumberland. Howick Hall website.', 'Y', 'Y', '', 'None', 'A6', 'Y', 'Open spaces and people.', 'Reopen the National Park centres. They were better for information than the Tourist info centres because the people who worked there seemed more interested. Also the T.I.Cs tend to be more of a gift shop and less about info.', 'A1', 'A1', 'A2', 'A2', 'A2', 'A7', 'A1', 'A1', 'A1', 'A7', 'A1', 'A1', 'A2', 'A3', 'A3', 'A1', 'A1', 'A1', '10', NULL, 'A1', 'A6', 'A1', 'A1', 'A2', 'A6', 'A6', 'A1', 'A6', 'A1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `lime_survey_62863` VALUES (161, '2013-08-23 19:34:43', 11, 'en', '2013-08-23 19:34:43', '2013-08-23 19:12:15', 'http://survey.ntads.co.uk/index.php?sid=62863&lang=en', 'A3', '', '', '', '', '', 'Y', '', '', '', '', '', '', '12', '', NULL, 'A3', '', NULL, 'A4', 'A5', '', '6', '6', '', NULL, 'Y', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', NULL, NULL, NULL, 'Visit Northumberland', 'A1', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', 'Y', '', 'Y', 'Y', '', '', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Berwick Museum, Lindisfarne', 'Y', 'Y', '', '', '', '', '', '', 'Y', 'Y', '', '', 'A1', NULL, 'The beauty and historical interest.', 'The A1 road through Northumberland.', 'A1', 'A1', 'A1', 'A4', 'A3', 'A7', 'A1', 'A2', 'A3', 'A7', 'A1', 'A1', 'A1', 'A1', 'A7', 'A1', 'A1', 'A1', '10', NULL, 'A1', 'A2', 'A1', 'A1', 'A1', 'A6', 'A4', 'A1', 'A1', 'A1', 'N', 'A3', 'A3', 'Y', 'Y', 'It is a beautiful county full of historic interest. Brilliant for natural history too! You can never be bored whatever the weather or time of year. There is always something to do or see. Full of very kind people who will always take the time to pass the time of day.\r\n  The main reason is that it is my county - I was raised most of my childhood in Berwick down the Greenses.\r\n', 'North Yorkshire.', 'A2', '', 5, 'A6', 20, '', '', '', 'nil', '', '', NULL, 'N', '', 'N', NULL, NULL, NULL);
