INSERT INTO `lime_survey_62863` VALUES (282, '2013-08-25 08:46:02', 11, 'en', '2013-08-25 08:46:02', '2013-08-25 07:51:31', 'http://survey.ntads.co.uk/index.php?sid=62863&lang=en', 'A3', '', '', 'Y', '', '', 'Y', '', '', '', '', '', '', 'A3', '', NULL, 'A3', '', NULL, 'A2', 'A2', '', '1', '1', '', NULL, 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, 'A1', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', 'Y', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'A1', NULL, 'The big skies and beautiful beaches. Gentle pace of life. The sky and  landscape have a beautiful quality of light. My husband would say The Ship at Low Newton. \r\nWe live in York, so Northumberland offers us a nice journey time, with a car full of complaining children. We and they love, the big outdoor spaces, the castles and so on, the art installations at Kielder, the Alnwick Garden and Barter Books and of course, the beaches. We visit several times a year, either on short breaks or longer 1-2 week breaks. We have camped (favourite site - Beadnell), we have stayed in hotels ( our latest was at the Dunstanburgh Castle , Embleton, which was very old fashioned in terms of decor but the service and food were excellent also the beds were very comfortable), and we have  self-catered many times ( our favourite place to stay is Bamburgh, though sadly our favourite cottage - Eight Bells is no longer available, we love the Coastal Retreats cottages but find them  expensive for a week in school  holidays).', 'We do lots of eating out when on holiday,  but over the years have found the choice of cafes and restaurants limited. We love the Ship at Low Newton with its simple menu and local produce (and good beer ),  Eleanor\\''s Byre at Craster is a good place to get  a cuppa and a nice cake in pleasant surroundings, there is a good farm shop at  Belford,  where we have had some very good breakfasts, and we also like to pick up some fresh or smoked seafood/ fish from Swallows or Robsons. We enjoy afternoon tea at Howick Hall. The Castle at Bamburgh do good pub grub. But apart from these places, we have also had some very disappointing meals, where the menus were too formal, too expensive and yet the quality was at best adequate.', 'A2', 'A2', 'A2', 'A4', 'A4', 'A7', 'A6', 'A1', 'A1', 'A6', 'A2', 'A2', 'A3', 'A2', 'A2', 'A2', 'A3', 'A3', 'A9', NULL, 'A2', 'A6', 'A2', 'A2', 'A2', 'A6', 'A3', 'A2', 'A2', 'A1', 'N', 'A6', 'A3', 'Y', 'Y', '', 'North Norfolk, Pembrokeshire, Edinburgh, for  holidays and short breaks\r\nDays out:  North York Moors,  Yorkshire Dales, North York Coast, Knaresborough area, Washington, Northallerton, Stokesley', 'A2', '', 5, 'A3', 25, '250', '130', '10', '60', '15', '', 5, 'Y', 'A6', 'Y', 'Kim Hastings', '01904 789534', 'Kim_i_hastings@yahoo.co.uk');
