INSERT INTO `lime_survey_62863` VALUES (350, '2013-09-01 20:25:33', 11, 'en', '2013-09-01 20:25:33', '2013-09-01 20:03:29', 'http://survey.ntads.co.uk/index.php?sid=62863&lang=en', 'A4', '', '', '', '', '', '', '', '', '', '', '', 'Y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8 ', '0', 'Esh Winning, Durham', NULL, 'Y', '', '', '', '', '', '', '', '', '', 'Y', '', 'Y', 'Y', '', '', '', 'National Trust', NULL, NULL, 'Tonias at Seaham', 'Visit Northumbria, Durham Tourism', 'A1', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', '', '', 'Y', 'Y', '', 'Y', 'Y', '', '', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', '', '', '', '', '', 'Y', '', '', '', '', '', '', '', '', 'Y', '', '', '', '', 'Alnwick Castle and Gardens, Dunstanburgh, Bamburgh, Lindisfarne, Seahouses', 'Y', '', '', 'Y', 'Y', 'Y', '', 'Attraction websites direct', 'Y', 'Y', '', 'Daily Mail, The i', 'A5', 'Y', 'The variety of activities available.  Friendliness of people.  Spectacular scenery and probably the best beach in the world (Bamburgh)!  Crab rolls.', 'Shops and cafes on Lindisfarne closing between 4.30 and 5.30pm.  Due to tide times we were unable to get to the island before 2pm.  By the time we had visited the Priory and the Castle and walked with the dogs everything had closed.  Apart from the local businesses missing out on custom, it was frankly, bizarre that they didn\\''t stay open to service the number of people on the island, doing day visits, of which there were many many many at 6pm.  The castle closed at 4.30 - National Trust - what are you thinking?  The islanders missed out on at 4 hours of business which could have been made-up for if they had stayed open later - the safe tide crossing was until 9.30/10pm.  We left at around 6pm and my teenagers still had there money in their purses which they were keen to spend!', 'A3', 'A2', 'A2', 'A3', 'A3', 'A7', 'A2', 'A2', 'A2', 'A7', 'A1', 'A2', 'A3', 'A1', 'A2', 'A7', 'A3', 'A2', 'A8', NULL, 'A2', 'A2', 'A1', 'A1', 'A3', 'A6', 'A3', 'A1', 'A1', 'A1', 'N', 'A2', 'A2', 'Y', 'Y', 'Many attractions are excellent for families/children - Alnwick Castle/Gardens are superb.  The beaches at Bamburgh are amongst the best in the world - great for sand dune \\''surfing\\''.  Would advise not to visit Lindisfarne unless you can cross early/mid-morning or you won\\''t find time to do everything before everything closes.   Alnwick Castle website did not make very clear that there are two separate attractions - castle + gardens - and there are separate charges for each one.', 'Lake District.  South Coast (Hampshire/West Sussex).  Dorset.  London.  ', 'A2', '', 5, 'A4', NULL, '0', '60.00', '125.00', '200.00', '100.00', '', 5, 'Y', 'A4', 'Y', 'Mrs Sarah Huddart', '07980001559', 'sarah_huddart@btinternet.com');
