INSERT INTO `lime_surveys_languagesettings` VALUES (92944, 'en', 'Tell us how you choose your accommodation and win a holiday in Northumberland', '<p>\r\n	<strong>Visitor Accommodation Survey</strong></p>\r\n<p>\r\n	We&rsquo;d love to know how you select your UK holiday accommodation.&nbsp; Fill in our short survey and go in the draw to win a holiday in Northumberland.</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '', '<p>\r\n	Thank you for participating in our survey.</p>\r\n', 'http://www.visitnorthumberland.com/competitions', 'Enter some more competitions', 'Invitation to participate in a survey', 'Dear {FIRSTNAME},<br /><br />you have been invited to participate in a survey.<br /><br />The survey is titled:<br />"{SURVEYNAME}"<br /><br />"{SURVEYDESCRIPTION}"<br /><br />To participate, please click on the link below.<br /><br />Sincerely,<br /><br />{ADMINNAME} ({ADMINEMAIL})<br /><br />----------------------------------------------<br />Click here to do the survey:<br />{SURVEYURL}<br /><br />If you do not want to participate in this survey and don''t want to receive any more invitations please click the following link:<br />{OPTOUTURL}', 'Reminder to participate in a survey', 'Dear {FIRSTNAME},<br /><br />Recently we invited you to participate in a survey.<br /><br />We note that you have not yet completed the survey, and wish to remind you that the survey is still available should you wish to take part.<br /><br />The survey is titled:<br />"{SURVEYNAME}"<br /><br />"{SURVEYDESCRIPTION}"<br /><br />To participate, please click on the link below.<br /><br />Sincerely,<br /><br />{ADMINNAME} ({ADMINEMAIL})<br /><br />----------------------------------------------<br />Click here to do the survey:<br />{SURVEYURL}<br /><br />If you do not want to participate in this survey and don''t want to receive any more invitations please click the following link:<br />{OPTOUTURL}', 'Survey registration confirmation', 'Dear {FIRSTNAME},<br /><br />You, or someone using your email address