INSERT INTO `lime_surveys_languagesettings` VALUES (71878, 'en', 'Visit Berwick - Add an event', '<p>\r\n	<strong>Welcome to the Visit Berwick Event Wizard.</strong></p>\r\n<p>\r\n	Please complete the step by step wizard to feature an event on <a href="http://www.visitberwick.com">www.visitberwick.com</a>.</p>\r\n', '<p>\r\n	If you have any queries regarding the wizard, please email <a href="mailto:l.dixon@berwick-tc.gov.uk?subject=Add%20an%20Event%20-%20Visit%20Berwick">l.dixon@berwick-tc.gov.uk</a>.</p>\r\n', '<p>\r\n	Thank you for providing your event details. We will aim to get this listed on the website within the next 7 days.&nbsp;</p>\r\n<p>\r\n	If you have any queries during this time, please  email <a href="mailto:l.dixon@berwick-tc.gov.uk?subject=Add%20an%20Event%20-%20Visit%20Berwick">l.dixon@berwick-tc.gov.uk</a>.</p>\r\n', 'http://www.visitberwick.com/whats-on/', '', 'Invitation to participate in a survey', 'Dear {FIRSTNAME},<br /><br />you have been invited to participate in a survey.<br /><br />The survey is titled:<br />"{SURVEYNAME}"<br /><br />"{SURVEYDESCRIPTION}"<br /><br />To participate, please click on the link below.<br /><br />Sincerely,<br /><br />{ADMINNAME} ({ADMINEMAIL})<br /><br />----------------------------------------------<br />Click here to do the survey:<br />{SURVEYURL}<br /><br />If you do not want to participate in this survey and don''t want to receive any more invitations please click the following link:<br />{OPTOUTURL}', 'Reminder to participate in a survey', 'Dear {FIRSTNAME},<br /><br />Recently we invited you to participate in a survey.<br /><br />We note that you have not yet completed the survey, and wish to remind you that the survey is still available should you wish to take part.<br /><br />The survey is titled:<br />"{SURVEYNAME}"<br /><br />"{SURVEYDESCRIPTION}"<br /><br />To participate, please click on the link below.<br /><br />Sincerely,<br /><br />{ADMINNAME} ({ADMINEMAIL})<br /><br />----------------------------------------------<br />Click here to do the survey:<br />{SURVEYURL}<br /><br />If you do not want to participate in this survey and don''t want to receive any more invitations please click the following link:<br />{OPTOUTURL}', 'Survey registration confirmation', 'Dear {FIRSTNAME},<br /><br />You, or someone using your email address, have registered to participate in an online survey titled {SURVEYNAME}.<br /><br />To complete this survey, click on the following URL:<br /><br />{SURVEYURL}<br /><br />If you have any questions about this survey, or if you did not register to participate and believe this email is in error, please contact {ADMINNAME} at {ADMINEMAIL}.', 'Confirmation of your participation in our survey', 'Dear {FIRSTNAME},<br /><br />this email is to confirm that you have completed the survey titled {SURVEYNAME} and your response has been saved. Thank you for participating.<br /><br />If you have any further questions about this email, please contact {ADMINNAME} on {ADMINEMAIL}.<br /><br />Sincerely,<br /><br />{ADMINNAME}', 1, 'Response submission for survey {SURVEYNAME}', 'Hello,<br /><br />A new response was submitted for your survey ''{SURVEYNAME}''.<br /><br />Click the following link to reload the survey:<br />{RELOADURL}<br /><br />Click the following link to see the individual response:<br />{VIEWRESPONSEURL}<br /><br />Click the following link to edit the individual response:<br />{EDITRESPONSEURL}<br /><br />View statistics by clicking here:<br />{STATISTICSURL}', 'Response submission for survey {SURVEYNAME} with results', '<style type="text/css">\n                                                .printouttable {\n                                                  margin:1em auto;\n                                                }\n                                                .printouttable th {\n                                                  text-align: center;\n                                                }\n                    