r />Click the following link to edit the individual response:<br />{EDITRESPONSEURL}<br /><br />View statistics by clicking here:<br />{STATISTICSURL}<br /><br /><br />The following answers were given by the participant:<br />{ANSWERTABLE}', 0);
INSERT INTO `lime_surveys_languagesettings` VALUES (61378, 'en', 'Spirit in Stone - Add an event', '<p>\r\n	<strong>Welcome to the Spirit in Stone Event Wizard.</strong></p>\r\n<p>\r\n	Please complete the step by step wizard to feature an event on <a href="http://www.spiritinstone.co.uk">www.spiritinstone.co.uk</a>.</p>\r\n', '<p>\r\n	If you have any queries regarding the wizard, please email <a href="mailto:spiritinstoneproject@gmail.com?subject=Add%20an%20event%20-%20Spirit%20in%20Stone%20website">spiritinstoneproject@gmail.com</a>.</p>\r\n', '<p>\r\n	Thank you for providing your event details. We will aim to get this listed on the website within the next 7 days.&nbsp;</p>\r\n<p>\r\n	If you have any queries during this time, please email <a href="mailto:spiritinstoneproject@gmail.com?subject=Add%20an%20event%20-%20Spirit%20in%20Stone%20website">spiritinstoneproject@gmail.com</a>.</p>\r\n', 'http://www.spiritinstone.co.uk/whats-on/', '', 'Invitation to participate in a survey', 'Dear {FIRSTNAME},<br /><br />you have been invited to participate in a survey.<br /><br />The survey is titled:<br />"{SURVEYNAME}"<br /><br />"{SURVEYDESCRIPTION}"<br /><br />To participate, please click on the link below.<br /><br />Sincerely,<br /><br />{ADMINNAME} ({ADMINEMAIL})<br /><br />----------------------------------------------<br />Click here to do the survey:<br />{SURVEYURL}<br /><br />If you do not want to participate in this survey and don''t want to receive any more invitations please click the following link:<br />{OPTOUTURL}', 'Reminder to participate in a survey', 'Dear {FIRSTNAME},<br /><br />Recently we invited you to participate in a survey.<br /><br />We note that you have not yet completed the survey, and wish to remind you that the survey is still available should you wish to take part.<br /><br />The survey is titled:<br />"{SURVEYNAME}"<br /><br />"{SURVEYDESCRIPTION}"<br /><br />To participate, please click on the link below.<br /><br />Sincerely,<br /><br />{A